// Core
import styled from 'styled-components';

export const Message = styled.div`
    color: saddleBrown;
    margin-bottom: 10px;
    font-size: 30px;
    font-weight: 500;
    min-height: 30px;
    text-align: center;
    user-select: none;
`;
